import React, { Component } from 'react';
import { connect } from 'react-redux';
import NavButtons from './NavButtons';
import Inputs from './Inputs';

const mapStateToProps = state => {
    return {
        logIn: state.userLogInData.logIn,
        name: state.userLogInData.name
    }
}

class Home extends Component {
    render() {
        if (this.props.logIn === true) {
            return (
                <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#3830ab' }}>
                    <div>
                        <h1 style={{ color: 'white', fontSize: '9vw' }} >Home</h1>
                        <NavButtons/>
                        <h1 style={{ color: 'white', fontSize: '1vw' }} >Logged in as: {this.props.name} </h1>
                    </div>
                </div>
            )
        }
        else if (this.props.logIn === false) {
            return (
                <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#3830ab' }}>
                    <div>
                        <h1 style={{ color: 'white', fontSize: '9vw' }} >HOME</h1>
                        <Inputs/>
                    </div>
                </div>
            )
        } else {
            return null;
        }
    }
}

export default connect(mapStateToProps)(Home)
